class Solution {
    public int minimumCoins(int[] prices) {
        int n = prices.length;
        int[] dp = new int[n];
        dp[0] = prices[0]; // Cost of the first fruit
        for (int i = 1; i < n; i++) {
            dp[i] = dp[i - 1] + prices[i]; // Initial cost without offers
            for (int j = 0; j < i; j++) {
                if (j + prices[j] >= i) { // Check if the offer from buying the jth fruit covers ith fruit
                    dp[i] = Math.min(dp[i], dp[j] + prices[i]); // Min cost between current and new offer
                }
            }
        }
        int minCost = dp[0];
        for (int i = 1; i < n; i++) {
            if (i + prices[i] >= n) { // Last purchase can cover all remaining fruits
                minCost = Math.min(minCost, dp[i]);
            }
        }
        return minCost;
    }
}
